import React, { useState } from 'react';
import Krangeslider from './rangeslider';

function KrangesliderLadder () {

  const [ value, setValue ] = useState(50);

  return (
    <div class='inlined'>
      <span>Cold Glass Of Milk</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <p/>
      <span>Black Licorice</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <p/>
      <span>Green Pep</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <p/>
      <span>White Chocolate</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <p/>
      <span>OJ w/ Pulp</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <p/>
      <span>Sumac</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <p/>
      <span>Nuts in Brownies</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <p/>
      <span>Pineapple on Pizza</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <p/>
      <span>Raisins</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <p/>
      <span>Mayonaise</span>
      <Krangeslider
        value={value}
        onChange={changeEvent => setValue(changeEvent.target.value)}
      />
      <p/>
    </div>

  );

};

export default KrangesliderLadder;
